import React, { Component } from 'react';
import Input from './Input';

export default class Form extends Component {
  render() {
    return (
      <>
        <Input
          type="text"
          label="Nome"
          id="InputName"
          dataTest="name-input"
        />
        <Input
          type="number"
          label="Descrição da carta"
          id="descTextArea"
          dataTest="description-input"
        />
      </>
    );
  }
}
